import styled from 'styled-components'
const About = styled.div `
    width: 80%;
    height: 60vh;
    border: 1.25px solid white;
    border-radius: 5px;
    color: white;
    font-size:
    font-family: 'Love Ya Like A Sister' ;
`

const AboutMe = () => {

    return (
        <About>

            <p>
              Full stack engineer | Lover of art |   
            </p>
        </About>
    )
}

export default AboutMe
